import React from 'react';
import './form.css'

class Form extends React.Component {
    render () {
    return (
        <div>
        <form id="contactForm" method="POST" action="./index.php">
        <label>Name</label>
        <input type="name" id="name"  placeholder="Enter Your Name Here"></input>

        <label>Email</label>
        <input type="email" id="email" placeholder="Enter Your Email Here"></input>

        <label>Message</label>
        <textarea type="message" id="message" placeholder="Enter Your Message Here"></textarea>

        <input id="submit" name="submit" type="submit" value="submit"></input>
      </form>

    
    </div>
    );
    }
}


export default Form;
